import './App.css';
import React from "react";
import { ListGroup } from 'react-bootstrap';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
      restaurants: [],
    };
  }


  componentDidMount(){
    fetch("restaurants.json")
    .then(response => {
        console.log(response);
        return response.json()
    })
    .then(data => {
        console.log(data);
        this.setState({restaurants:data});
    })
    .catch(error => {
        console.log("Error", error);
    });
  }


  render() { 

    const {restaurants} = this.state;
    console.log("i am here", restaurants);

    return ( 
      <div className="App">

        <table className="titleBar">
          <tbody>
            <tr>
              <td>
                <img alt="app icon" width="50" src ="restaurant.svg"/>
                </td>
                <td width="8"/>
                <td>
                  <h1>MakanBah</h1>
                </td>
            </tr>
          </tbody>
        </table>

        <input placeholder="Enter Search"/>

        <tbody>
          <tr>
            <td>
              {/* <img alt="poster" src="https://maps.googleapis.com/maps/api/place/details/json?photo_reference=ATtYBwJztZ5fRPa7mBQf0jKAT2pcL7bPN0RL0EFmyt3X6wlO_xMsyqe2SpI0BBOkzlCmxpO1_DXpqbzOCaZ2vq-koQlrKqQBo2Vy9N-IvXCsNsX6e3dmKYDlOQTx8ELWky-3ngkCOi7pl2Gp0y4Dl-Np44NXLKbRojx3Y66Ilep8KS1wTq7_&sensor=true&key=AIzaSyAsM-TE6HjRKxM8Tph0HmDmwyaWgRYSuaM"/> */}
              <img alt="poster" src="http://www.panoramio.com/map/get_panoramas.php?set=public&from=0&to=20&minx=5.9804&miny=116.0735&maxx=5.9804&maxy=116.0735&size=medium&mapfilter=true"/>
              src="https://maps.googleapis.com/maps/api/place/photo?maxwidth=400&photoreference=CnRvAAAAwMpdHeWlXl-lH0vp7lez4znKPIWSWvgvZFISdKx45AwJVP1Qp37YOrH7sqHMJ8C-vBDC546decipPHchJhHZL94RcTUfPa1jWzo-rSHaTlbNtjh-N68RkcToUCuY9v2HNpo5mziqkir37WU8FJEqVBIQ4k938TI3e7bf8xq-uwDZcxoUbO_ZJzPxremiQurAYzCTwRhE_V0&sensor=false&key=AIzaSyAsM-TE6HjRKxM8Tph0HmDmwyaWgRYSuaM"/>
            </td>
            <td>
              {restaurants.map(item=>
              <ul key={item.place_id}>
                {item.name} {item.rating} {item.photo_reference}
              </ul>
                )}
            </td>
          </tr>
        </tbody>






        <h1>Makanbah</h1>
        <h3>Restaurant Finder</h3>
        <h4>Total Restaurants: {restaurants.length}</h4>
        <div className="list">
          <div className="container">
            <div className="box-grid-list">
              <ul>
                {restaurants.map(item=>
                  <ListGroup.Item key={item.name}>
                    {item.name}
                    ratings: {item.rating} 
                  </ListGroup.Item>
                )}
              </ul>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;







